{
  "name": "oxc",
  "private": true,
  "packageManager": "pnpm@9.15.0",
  "volta": {
    "node": "22.12.0"
  },
  "scripts": {
    "build": "pnpm --workspace-concurrency=1 --filter './napi/*' build",
    "build-dev": "pnpm --workspace-concurrency=1 --filter './napi/*' build-dev",
    "test": "pnpm --workspace-concurrency=1 --filter './napi/*' test"
  },
  "devDependencies": {
    "@napi-rs/cli": "catalog:",
    "typescript": "catalog:",
    "vitest": "catalog:"
  }
}

lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

catalogs:
  default:
    '@napi-rs/cli':
      specifier: 3.0.0-alpha.61
      version: 3.0.0-alpha.61
    typescript:
      specifier: 5.6.3
      version: 5.6.3
    vitest:
      specifier: 2.1.2
      version: 2.1.2

importers:

  .:
    devDependencies:
      '@napi-rs/cli':
        specifier: 'catalog:'
        version: 3.0.0-alpha.61(@emnapi/runtime@1.3.1)
      typescript:
        specifier: 'catalog:'
        version: 5.6.3
      vitest:
        specifier: 'catalog:'
        version: 2.1.2(@types/node@22.10.2)

